type snapshotTree struct {
	snapshot
	children []*snapshotTree
}

func TestTree(t *testing.T) {
	arr := []snapshot{}
	err := json.Unmarshal([]byte(payload), &arr)
	if err != nil {
		t.Fatal(err)
	}

	m := map[int32]*snapshotTree{}
	for _, s := range arr {
		m[s.Pid] = &snapshotTree{
			snapshot: s,
			children: []*snapshotTree{},
		}
	}

	for _, s := range arr {
		parent := m[s.Ppid]
		if parent == nil {
			fmt.Printf("%#v\n", s)
			continue
		}

		child := m[s.Pid]
		parent.children = append(parent.children, child)
	}

	for _, tree := range m {
		sort.Slice(tree.children, func(i, j int) bool {
			return tree.children[i].MemCumul > tree.children[j].MemCumul
		})
	}

	root := m[1]
	printTree(root, 0)
}

func printTree(tree *snapshotTree, level int) {
	//j, _ := json.Marshal(tree)
	//info := string(j)
	info := fmt.Sprintf("%s(%d) mem=%0.3f%% cpu=%0.3f%%", tree.Name, tree.Pid, tree.MemCumul, tree.CpuPct)
	fmt.Printf("%s%s\n", strings.Repeat(" ", level), info)

	for _, child := range tree.children {
		printTree(child, level+2)
	}
}

func TestChart(t *testing.T) {
	bar := charts.NewBar()
	bar.SetGlobalOptions(
		charts.WithTitleOpts(opts.Title{
			Title:    "Memory usage during aidansteele/example-repo e2e job",
			Subtitle: "#806",
		}),
		charts.WithTooltipOpts(opts.Tooltip{
			Show:      true,
			Formatter: "{a}: {c}%",
		}),
		charts.WithYAxisOpts(opts.YAxis{
			AxisLabel: &opts.AxisLabel{Show: true, Formatter: "{value}%"},
			Max:       100,
		}),
	)

	moments := [][]snapshot{}
	names := []string{}

	byPid := map[int32][]*snapshot{}
	allPids := []int32{}

	durLabel := time.Duration(0)

	lines := strings.Split(payload2, "\n")
	for _, line := range lines {
		moment := []snapshot{}
		err := json.Unmarshal([]byte(line), &moment)
		if err != nil {
			t.Fatal(err)
		}

		sort.Slice(moment, func(i, j int) bool {
			return moment[i].Name < moment[j].Name
		})

		for _, s := range moment {
			s := s
			byPid[s.Pid] = append(byPid[s.Pid], &s)
			allPids = append(allPids, s.Pid)
		}

		moments = append(moments, moment)
		names = append(names, durLabel.String())
		durLabel += 5 * time.Second
	}

	bar.SetXAxis(names)

	var runnerWorkerPid int32 = 0
	for pid, snapshots := range byPid {
		if snapshots[0].Name == "Runner.Worker" {
			runnerWorkerPid = pid
			break
		}
	}

	deletes := []int32{}
	for _, pid := range allPids {
		snaps := byPid[pid]
		if len(snaps) == 0 {
			continue
		}

		s := snaps[0]
		ppid := s.Ppid
		for ppid != runnerWorkerPid && ppid != 0 {
			parentSnaps := byPid[ppid]
			if len(parentSnaps) == 0 {
				break
			}

			ppid = parentSnaps[0].Ppid
		}

		if ppid == 0 {
			deletes = append(deletes, pid)
		}
	}

	aggregateUsageOutsideWorker(byPid, runnerWorkerPid, bar)

	for _, pid := range deletes {
		delete(byPid, pid)
	}

	for _, snapshots := range byPid {
		s := snapshots[0]
		name := fmt.Sprintf("%s (%d)", s.Name, s.Pid)

		vals := []opts.BarData{}

		for _, s2 := range snapshots {
			vals = append(vals, opts.BarData{Name: name, Value: s2.MemPct})
		}

		bar.AddSeries(name, vals)
	}

	bar.SetSeriesOptions(charts.WithBarChartOpts(opts.BarChart{
		Type:  types.ChartBar,
		Stack: "stackA",
	}))

	// Where the magic happens
	f, _ := os.Create("bar.html")
	bar.Render(f)
}

func descendantPids(root int32, snapshots []*snapshot, byPid map[int32]*snapshot) []int32 {
	descendants := []int32{}

	for _, s := range snapshots {
		ppid := s.Ppid
		for ppid != root && ppid != 0 {
			parent := byPid[ppid]
			if parent == nil {
				break
			}

			ppid = parent.Ppid
		}

		if ppid != 0 {
			descendants = append(descendants, s.Pid)
		}
	}

	return descendants
}

func aggregateUsageOutsideWorker(byPid map[int32][]*snapshot, runnerWorkerPid int32, bar *charts.Bar) {
	name := "(other)"
	otherVals := []opts.BarData{}

	var initPid int32 = 1

	for idx, initSnapshot := range byPid[initPid] {
		runnerWorkerSnapshot := byPid[runnerWorkerPid][idx]
		delta := initSnapshot.MemCumul - runnerWorkerSnapshot.MemCumul
		otherVals = append(otherVals, opts.BarData{
			Name:  name,
			Value: delta,
			ItemStyle: &opts.ItemStyle{
				Color: "grey",
			},
		})
	}

	bar.AddSeries(name, otherVals)
}

